import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="top">
        <p>Top</p>
        <button aria-label="Toggle side bar menu" class="AppHeaderControlButton" type="button">
        <svg width="36" height="36" viewBox="0 0 36 36">
        <title>Toggle menu</title>
        <g transform="translate(0 -1)" fill="none" fill-rule="evenodd">
        <path d="M0 0h36v36H0z"></path>
        <rect fill="currentColor" x="6" y="8" width="24" height="3" rx=".893"></rect>
        <rect fill="currentColor" x="6" y="17" width="24" height="3" rx=".893"></rect>
        <rect fill="currentColor" x="6" y="26" width="24" height="3" rx=".893"></rect>
        </g>
        </svg>
        </button>
        </div>
        <div className="row">
          <div className="column left">
          <p>Left</p>
          </div>
          <div className="column right">
          <p>Right</p>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
